import React from 'react';

const QuestionCard = ({
  questionNumber,
  totalQuestions,
  question,
  answers,
  onAnswerClick,
}) => (
    <div className="QuestionCard">
        <p>Domanda {questionNumber} di {totalQuestions}</p>
        <h3>{question}</h3>
        <ul>
            {answers.map((answer, index) => (
                <li key={index}>
                    <button onClick={() => onAnswerClick(index)}>{answer}</button>
                </li>
            ))}
        </ul>
    </div>
);

export default QuestionCard;
